&quot;I love so many people. Your mate doesn't have to replace everything. I don't know and I'm not going to pretend I do. It's back to basics, being self-sufficient. Now I'm back to how I was as a kid when I used to spend most of my time alone. So I'm spending time by myself and enjoying it very much. It sounds sad, but when I was a kid I didn't really have friends. The most magical moments I had in my life I had alone. Like climbing mountains or swimming or singing or listening to music.&quot;
 - Raygun, September 1997



